import React from 'react';

export default function Footercol({
  heading = 'col heading',
  Links = [
    {
      type: 'Link',
      title: 'Home',
      path: './home',
    },
    {
      type: 'Link',
      title: 'About',
      path: './about',
    },
  ],
}) {
  return (
    <div>
      <h1 className="heading">{heading}</h1>
      <ul>{Links.map((item, index) => (
        <li key={index}>
          
        </li>
      ))
    }</ul>
    </div>
  );
}
